// SubmitFeedback.js
import React, { useState } from "react";
import "./SubmitFeedback.css";

function SubmitFeedback() {
  const [mentorName, setMentorName] = useState("");
  const [week, setWeek] = useState("");
  const [hours, setHours] = useState("");
  const [answeredAll, setAnsweredAll] = useState("");
  const [openQueries, setOpenQueries] = useState("");
  const [queryDetails, setQueryDetails] = useState("");
  const [linesOfCode, setLinesOfCode] = useState("");
  const [rating, setRating] = useState(""); // new rating field
  const [message, setMessage] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();

    const feedbackData = {
      mentorName,
      week,
      hours,
      answeredAll,
      openQueries,
      queryDetails,
      linesOfCode,
      rating,
    };

    console.log("Submitted Feedback:", feedbackData);

    // reset form
    setMentorName("");
    setWeek("");
    setHours("");
    setAnsweredAll("");
    setOpenQueries("");
    setQueryDetails("");
    setLinesOfCode("");
    setRating("");
    setMessage("Feedback submitted successfully!");
  };

  return (
    <div className="feedback-container">
      <h2>Submit New Feedback</h2>

      {message && <p className="success-msg">{message}</p>}

      <form onSubmit={handleSubmit} className="feedback-form">
        <label>
          Your Mentor full name:
          <input
            type="text"
            value={mentorName}
            onChange={(e) => setMentorName(e.target.value)}
            required
          />
        </label>

        <label>
          Choose the Week you are providing review for:
          <select value={week} onChange={(e) => setWeek(e.target.value)} required>
            <option value="">Select Week</option>
            <option value="Week 1">Week 1</option>
            <option value="Week 2">Week 2</option>
            <option value="Week 3">Week 3</option>
            <option value="Week 4">Week 4</option>
          </select>
        </label>

        <label>
          Approximately how many hours did your mentor spend with you this week?
          <input
            type="number"
            value={hours}
            min="0"
            max="10"
            onChange={(e) => setHours(e.target.value)}
            required
          />
        </label>

        <label>
          Did your mentor answer all your questions this week?
          <select value={answeredAll} onChange={(e) => setAnsweredAll(e.target.value)} required>
            <option value="">Select</option>
            <option value="Yes">Yes</option>
            <option value="No">No</option>
          </select>
        </label>

        <label>
          Do you have any unresolved questions or topics for this week?
          <select value={openQueries} onChange={(e) => setOpenQueries(e.target.value)} required>
            <option value="">Select</option>
            <option value="Yes">Yes</option>
            <option value="No">No</option>
          </select>
        </label>

        <label>
          If you have open queries, please describe them (Type NA if none):
          <textarea
            value={queryDetails}
            onChange={(e) => setQueryDetails(e.target.value)}
            rows="3"
            required
          ></textarea>
        </label>

        <label>
          How many lines of code did you write this week? (Type N/A if not applicable)
          <input
            type="text"
            value={linesOfCode}
            onChange={(e) => setLinesOfCode(e.target.value)}
          />
        </label>

        <label>
          Rate your mentor (1-5 stars):
          <select value={rating} onChange={(e) => setRating(e.target.value)} required>
            <option value="">Select Rating</option>
            <option value="1">★☆☆☆☆</option>
            <option value="2">★★☆☆☆</option>
            <option value="3">★★★☆☆</option>
            <option value="4">★★★★☆</option>
            <option value="5">★★★★★</option>
          </select>
        </label>

        <button type="submit">Submit Feedback</button>
      </form>
    </div>
  );
}

export default SubmitFeedback;
